INSERT INTO "chat_message" VALUES(9,'2024-06-07 16:30:57.757855','Привіт, Романе, Максиме! Як справи?',1,7,27);
INSERT INTO "chat_message" VALUES(10,'2024-06-07 16:31:20.240335','Привіт, Тарасе! Все добре, дякую. Як ти?',1,8,23);
INSERT INTO "chat_message" VALUES(11,'2024-06-07 16:31:30.685073','Привіт усім! У мене теж все гаразд. Як ваші проєкти?',0,9,23);
INSERT INTO "chat_message" VALUES(12,'2024-06-07 16:31:40.468145','У мене зараз дуже цікавий проєкт. Ми працюємо над новим застосунком для управління завданнями. А ви чим займаєтесь?',0,7,23);
INSERT INTO "chat_message" VALUES(13,'2024-06-07 16:31:51.604671','Я зараз займаюсь розробкою веб-сайту для однієї великої компанії. Вони хочуть щось дуже сучасне та інтерактивне. Дуже багато роботи, але цікаво.',0,8,23);
INSERT INTO "chat_message" VALUES(14,'2024-06-07 16:32:05.545392','Я теж працюю над цікавим проєктом. Ми створюємо систему для автоматизації бізнес-процесів. Вона повинна допомогти компаніям зекономити час та ресурси.',0,9,23);
INSERT INTO "chat_message" VALUES(15,'2024-06-07 16:32:24.701926','Звучить круто! До речі, чи ви чули про новий фреймворк, який нещодавно вийшов? Кажуть, що він дуже зручний для створення веб-застосунків.',0,7,23);
INSERT INTO "chat_message" VALUES(16,'2024-06-07 16:32:36.722234','Так, я читав про нього. Називається він Svelte. Він дуже легкий і швидкий, що робить його ідеальним для інтерактивних інтерфейсів.',0,8,23);
INSERT INTO "chat_message" VALUES(17,'2024-06-07 16:34:00.813647','Привіт, Петре! Давно не бачилися. Як справи?',1,7,24);
INSERT INTO "chat_message" VALUES(18,'2024-06-07 16:34:13.279443','Привіт, Тарасе! Все добре, дякую. А як ти? Чим займаєшся останнім часом?',1,6,24);
INSERT INTO "chat_message" VALUES(19,'2024-06-07 16:35:40.099141','У мене все добре. Останнім часом захопився машинами. Купив собі новий автомобіль.',1,7,24);
INSERT INTO "chat_message" VALUES(20,'2024-06-07 16:35:51.568557','Це цікаво! Яку машину ти купив?',1,6,24);
INSERT INTO "chat_message" VALUES(21,'2024-06-07 16:36:04.253784','Взяв собі BMW X5. Вона просто чудова! Дуже комфортна та потужна.',0,7,24);
